'use strict';

exports.name = 'TwilioResponse';

exports.setUp = (app, mongoose) =>
{
  const schema = new mongoose.Schema({
    request: String,
    createdAt: Date,
    payload: {}
  }, {
    id: false
  });

  return schema;
};
